import React, { Component } from 'react'
import LoginSection from './LoginSection'


class LoginScreen extends Component {

    render(){
        return(
            <div>
                <Header />
                Below is a log-in Section:
                <LoginSection />
                <SignUpCTA />
            </div>
            )
    }
}


class Header extends Component {
    constructor(props){
        this.NavItems = this.NavItems.bind()
        const navItem=['a','b','c']
    }

    NavItems(){

    }
    render(){
        return(
            <div>
                <img id="logoInHeader" src='logo_ReStudio@3x.svg' alt='A logo of react studio'/>
                <nav>
                    this.props.navItems.map((item) => 
                        <a href="#" class="navItem">{item}}</a>
                    )

                    <a href="#" class="navItem">App Cases</a>
                    <a href="#" class="navItem">Pricing</a>
                    <a href="#" class="navItem">Support</a>
                </nav>
                <button>Sign Up</button>
            </div>
            )
    }
}
class SignUpCTA extends Component {

    render(){
        return(
            <div>
               You should really sign up for React Studio!
            </div>
            )
    }
}

export default LoginScreen
